{"metadata":{"colab":{"name":"Curso_de_Estatística_Parte_1.ipynb","provenance":[],"toc_visible":true,"version":"0.3.2"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":8302622,"sourceType":"datasetVersion","datasetId":4932401}],"dockerImageVersionId":30618,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"***\n# <font color=green size=10>CURSO DE ESTATÍSTICA - PARTE 1</font>\n***","metadata":{"colab_type":"text","id":"WvMflodMjQKe"}},{"cell_type":"markdown","source":"# <font color=green>1 CONHECENDO OS DADOS</font>\n***","metadata":{"colab_type":"text","id":"cVgsZ_E3jQKg"}},{"cell_type":"markdown","source":"## <font color=green>1.1 Dataset do projeto</font>\n***","metadata":{"colab_type":"text","id":"TDjqYYNojQKh"}},{"cell_type":"markdown","source":"### Pesquisa Nacional por Amostra de Domicílios - 2015\n\nA <b>Pesquisa Nacional por Amostra de Domicílios - PNAD</b> investiga anualmente, de forma permanente, características gerais da população, de educação, trabalho, rendimento e habitação e outras, com periodicidade variável, de acordo com as necessidades de informação para o país, como as características sobre migração, fecundidade, nupcialidade, saúde, segurança alimentar, entre outros temas. O levantamento dessas estatísticas constitui, ao longo dos 49 anos de realização da pesquisa, um importante instrumento para formulação, validação e avaliação de políticas orientadas para o desenvolvimento socioeconômico e a melhoria das condições de vida no Brasil.","metadata":{"colab_type":"text","id":"iN1gIbaKjQKh"}},{"cell_type":"markdown","source":"### Fonte dos Dados\n\nhttps://ww2.ibge.gov.br/home/estatistica/populacao/trabalhoerendimento/pnad2015/microdados.shtm","metadata":{"colab_type":"text","id":"U6V7br1RjQKi"}},{"cell_type":"markdown","source":"### Variáveis utilizadas\n\n> ### Renda\n> ***\n\nRendimento mensal do trabalho principal para pessoas de 10 anos ou mais de idade.\n\n> ### Idade\n> ***\n\nIdade do morador na data de referência em anos.\n\n> ### Altura (elaboração própria)\n> ***\n\nAltura do morador em metros.\n\n> ### UF\n> ***\n\n|Código|Descrição|\n|---|---|\n|11|Rondônia|\n|12|Acre|\n|13|Amazonas|\n|14|Roraima|\n|15|Pará|\n|16|Amapá|\n|17|Tocantins|\n|21|Maranhão|\n|22|Piauí|\n|23|Ceará|\n|24|Rio Grande do Norte|\n|25|Paraíba|\n|26|Pernambuco|\n|27|Alagoas|\n|28|Sergipe|\n|29|Bahia|\n|31|Minas Gerais|\n|32|Espírito Santo|\n|33|Rio de Janeiro|\n|35|São Paulo|\n|41|Paraná|\n|42|Santa Catarina|\n|43|Rio Grande do Sul|\n|50|Mato Grosso do Sul|\n|51|Mato Grosso|\n|52|Goiás|\n|53|Distrito Federal|\n\n> ### Sexo\t\n> ***\n\n|Código|Descrição|\n|---|---|\n|0|Masculino|\n|1|Feminino|\n\n> ### Anos de Estudo\n> ***\n\n|Código|Descrição|\n|---|---|\n|1|Sem instrução e menos de 1 ano|\n|2|1 ano|\n|3|2 anos|\n|4|3 anos|\n|5|4 anos|\n|6|5 anos|\n|7|6 anos|\n|8|7 anos|\n|9|8 anos|\n|10|9 anos|\n|11|10 anos|\n|12|11 anos|\n|13|12 anos|\n|14|13 anos|\n|15|14 anos|\n|16|15 anos ou mais|\n|17|Não determinados| \n||Não aplicável|\n\n> ### Cor\n> ***\n\n|Código|Descrição|\n|---|---|\n|0|Indígena|\n|2|Branca|\n|4|Preta|\n|6|Amarela|\n|8|Parda|\n|9|Sem declaração|","metadata":{"colab_type":"text","id":"r0Fe_qnzjQKj"}},{"cell_type":"markdown","source":"#### <font color='red'>Observação</font>\n***\n> Os seguintes tratamentos foram realizados nos dados originais:\n> 1. Foram eliminados os registros onde a <b>Renda</b> era inválida (999 999 999 999);\n> 2. Foram eliminados os registros onde a <b>Renda</b> era missing;\n> 3. Foram considerados somente os registros das <b>Pessoas de Referência</b> de cada domicílio (responsável pelo domicílio).","metadata":{"colab_type":"text","id":"OK1IQH5cX7Gb"}},{"cell_type":"markdown","source":"### R (informações básicas)","metadata":{}},{"cell_type":"code","source":"sessionInfo()","metadata":{"execution":{"iopub.status.busy":"2024-05-03T21:19:09.955861Z","iopub.execute_input":"2024-05-03T21:19:09.957658Z","iopub.status.idle":"2024-05-03T21:19:09.996664Z"},"trusted":true},"execution_count":111,"outputs":[{"output_type":"display_data","data":{"text/plain":"R version 4.0.5 (2021-03-31)\nPlatform: x86_64-pc-linux-gnu (64-bit)\nRunning under: Ubuntu 20.04.6 LTS\n\nMatrix products: default\nBLAS:   /usr/lib/x86_64-linux-gnu/openblas-pthread/libblas.so.3\nLAPACK: /usr/lib/x86_64-linux-gnu/openblas-pthread/liblapack.so.3\n\nlocale:\n [1] LC_CTYPE=en_US.UTF-8       LC_NUMERIC=C              \n [3] LC_TIME=en_US.UTF-8        LC_COLLATE=en_US.UTF-8    \n [5] LC_MONETARY=en_US.UTF-8    LC_MESSAGES=en_US.UTF-8   \n [7] LC_PAPER=en_US.UTF-8       LC_NAME=C                 \n [9] LC_ADDRESS=C               LC_TELEPHONE=C            \n[11] LC_MEASUREMENT=en_US.UTF-8 LC_IDENTIFICATION=C       \n\nattached base packages:\n[1] stats     graphics  grDevices utils     datasets  methods   base     \n\nother attached packages:\n[1] ggplot2_3.4.4   glue_1.6.2      dplyr_1.1.4     bigrquery_1.4.2\n[5] httr_1.4.7     \n\nloaded via a namespace (and not attached):\n [1] Rcpp_1.0.11          pillar_1.9.0         compiler_4.0.5      \n [4] dbplyr_2.4.0         base64enc_0.1-3      tools_4.0.5         \n [7] digest_0.6.33        uuid_1.1-1           bit_4.0.5           \n[10] gtable_0.3.4         jsonlite_1.8.8       evaluate_0.23       \n[13] lifecycle_1.0.4      gargle_1.5.2         tibble_3.2.1        \n[16] pkgconfig_2.0.3      rlang_1.1.2          IRdisplay_1.1.0.9000\n[19] DBI_1.1.3            cli_3.6.1            IRkernel_1.3.2.9000 \n[22] fastmap_1.1.1        repr_1.1.6.9000      withr_2.5.2         \n[25] generics_0.1.3       fs_1.6.3             vctrs_0.6.5         \n[28] grid_4.0.5           bit64_4.0.5          tidyselect_1.2.0    \n[31] R6_2.5.1             fansi_1.0.5          pbdZMQ_0.3-10       \n[34] magrittr_2.0.3       scales_1.3.0         htmltools_0.5.7     \n[37] assertthat_0.2.1     colorspace_2.1-0     utf8_1.2.4          \n[40] munsell_0.5.0        crayon_1.5.2         Cairo_1.6-2         "},"metadata":{}}]},{"cell_type":"markdown","source":"### Importando bibliotecas \n#### A bilioteca dplyr\nhttps://www.rdocumentation.org/packages/dplyr","metadata":{}},{"cell_type":"code","source":"library(dplyr)","metadata":{"execution":{"iopub.status.busy":"2024-05-03T21:19:22.653838Z","iopub.execute_input":"2024-05-03T21:19:22.655557Z","iopub.status.idle":"2024-05-03T21:19:22.670017Z"},"trusted":true},"execution_count":113,"outputs":[]},{"cell_type":"markdown","source":"### <font color=red>Documentações:\n\n- [**select**](https://www.rdocumentation.org/packages/dplyr/versions/0.7.8/topics/select)\n- [**arrange**](https://www.rdocumentation.org/packages/dplyr/versions/0.7.8/topics/arrange)\n- [**read.csv**](https://www.rdocumentation.org/packages/utils/versions/3.6.1/topics/read.table)\n- [**head**](https://www.rdocumentation.org/packages/utils/versions/3.6.1/topics/head)","metadata":{}},{"cell_type":"markdown","source":"### Acessando a ajuda","metadata":{}},{"cell_type":"code","source":"?select","metadata":{"execution":{"iopub.status.busy":"2024-05-03T21:09:12.594277Z","iopub.execute_input":"2024-05-03T21:09:12.596021Z","iopub.status.idle":"2024-05-03T21:09:12.874183Z"},"trusted":true},"execution_count":51,"outputs":[{"output_type":"display_data","data":{"text/html":"\n<table width=\"100%\" summary=\"page for select {dplyr}\"><tr><td>select {dplyr}</td><td style=\"text-align: right;\">R Documentation</td></tr></table>\n\n<h2>Keep or drop columns using their names and types</h2>\n\n<h3>Description</h3>\n\n<p>Select (and optionally rename) variables in a data frame, using a concise\nmini-language that makes it easy to refer to variables based on their name\n(e.g. <code>a:f</code> selects all columns from <code>a</code> on the left to <code>f</code> on the\nright) or type (e.g. <code>where(is.numeric)</code> selects all numeric columns).\n</p>\n\n\n<h4>Overview of selection features</h4>\n\n<p>Tidyverse selections implement a dialect of R where operators make\nit easy to select variables:\n</p>\n\n<ul>\n<li> <p><code>:</code> for selecting a range of consecutive variables.\n</p>\n</li>\n<li> <p><code>!</code> for taking the complement of a set of variables.\n</p>\n</li>\n<li> <p><code>&amp;</code> and <code>|</code> for selecting the intersection or the union of two\nsets of variables.\n</p>\n</li>\n<li> <p><code>c()</code> for combining selections.\n</p>\n</li></ul>\n\n<p>In addition, you can use <strong>selection helpers</strong>. Some helpers select specific\ncolumns:\n</p>\n\n<ul>\n<li> <p><code>everything()</code>: Matches all variables.\n</p>\n</li>\n<li> <p><code>last_col()</code>: Select last variable, possibly with an offset.\n</p>\n</li>\n<li> <p><code>group_cols()</code>: Select all grouping columns.\n</p>\n</li></ul>\n\n<p>Other helpers select variables by matching patterns in their names:\n</p>\n\n<ul>\n<li> <p><code>starts_with()</code>: Starts with a prefix.\n</p>\n</li>\n<li> <p><code>ends_with()</code>: Ends with a suffix.\n</p>\n</li>\n<li> <p><code>contains()</code>: Contains a literal string.\n</p>\n</li>\n<li> <p><code>matches()</code>: Matches a regular expression.\n</p>\n</li>\n<li> <p><code>num_range()</code>: Matches a numerical range like x01, x02, x03.\n</p>\n</li></ul>\n\n<p>Or from variables stored in a character vector:\n</p>\n\n<ul>\n<li> <p><code>all_of()</code>: Matches variable names in a character vector. All\nnames must be present, otherwise an out-of-bounds error is\nthrown.\n</p>\n</li>\n<li> <p><code>any_of()</code>: Same as <code>all_of()</code>, except that no error is thrown\nfor names that don't exist.\n</p>\n</li></ul>\n\n<p>Or using a predicate function:\n</p>\n\n<ul>\n<li> <p><code>where()</code>: Applies a function to all variables and selects those\nfor which the function returns <code>TRUE</code>.\n</p>\n</li></ul>\n\n\n\n\n<h3>Usage</h3>\n\n<pre>\nselect(.data, ...)\n</pre>\n\n\n<h3>Arguments</h3>\n\n<table summary=\"R argblock\">\n<tr valign=\"top\"><td><code>.data</code></td>\n<td>\n<p>A data frame, data frame extension (e.g. a tibble), or a\nlazy data frame (e.g. from dbplyr or dtplyr). See <em>Methods</em>, below, for\nmore details.</p>\n</td></tr>\n<tr valign=\"top\"><td><code>...</code></td>\n<td>\n<p>&lt;<code>tidy-select</code>&gt; One or more unquoted\nexpressions separated by commas. Variable names can be used as if they\nwere positions in the data frame, so expressions like <code>x:y</code> can\nbe used to select a range of variables.</p>\n</td></tr>\n</table>\n\n\n<h3>Value</h3>\n\n<p>An object of the same type as <code>.data</code>. The output has the following\nproperties:\n</p>\n\n<ul>\n<li><p> Rows are not affected.\n</p>\n</li>\n<li><p> Output columns are a subset of input columns, potentially with a different\norder. Columns will be renamed if <code>new_name = old_name</code> form is used.\n</p>\n</li>\n<li><p> Data frame attributes are preserved.\n</p>\n</li>\n<li><p> Groups are maintained; you can't select off grouping variables.\n</p>\n</li></ul>\n\n\n\n<h3>Methods</h3>\n\n<p>This function is a <strong>generic</strong>, which means that packages can provide\nimplementations (methods) for other classes. See the documentation of\nindividual methods for extra arguments and differences in behaviour.\n</p>\n<p>The following methods are currently available in loaded packages:\ndbplyr (<code>tbl_lazy</code>), dplyr (<code>data.frame</code>).\n</p>\n\n\n<h3>Examples</h3>\n\n<p>Here we show the usage for the basic selection operators. See the\nspecific help pages to learn about helpers like <code>starts_with()</code>.\n</p>\n<p>The selection language can be used in functions like\n<code>dplyr::select()</code> or <code>tidyr::pivot_longer()</code>. Let's first attach\nthe tidyverse:\n</p>\n<div class=\"sourceCode r\"><pre>library(tidyverse)\n\n# For better printing\niris &lt;- as_tibble(iris)\n</pre></div>\n<p>Select variables by name:\n</p>\n<div class=\"sourceCode r\"><pre>starwars %&gt;% select(height)\n#&gt; # A tibble: 87 x 1\n#&gt;   height\n#&gt;    &lt;int&gt;\n#&gt; 1    172\n#&gt; 2    167\n#&gt; 3     96\n#&gt; 4    202\n#&gt; # i 83 more rows\n\niris %&gt;% pivot_longer(Sepal.Length)\n#&gt; # A tibble: 150 x 6\n#&gt;   Sepal.Width Petal.Length Petal.Width Species name         value\n#&gt;         &lt;dbl&gt;        &lt;dbl&gt;       &lt;dbl&gt; &lt;fct&gt;   &lt;chr&gt;        &lt;dbl&gt;\n#&gt; 1         3.5          1.4         0.2 setosa  Sepal.Length   5.1\n#&gt; 2         3            1.4         0.2 setosa  Sepal.Length   4.9\n#&gt; 3         3.2          1.3         0.2 setosa  Sepal.Length   4.7\n#&gt; 4         3.1          1.5         0.2 setosa  Sepal.Length   4.6\n#&gt; # i 146 more rows\n</pre></div>\n<p>Select multiple variables by separating them with commas. Note how\nthe order of columns is determined by the order of inputs:\n</p>\n<div class=\"sourceCode r\"><pre>starwars %&gt;% select(homeworld, height, mass)\n#&gt; # A tibble: 87 x 3\n#&gt;   homeworld height  mass\n#&gt;   &lt;chr&gt;      &lt;int&gt; &lt;dbl&gt;\n#&gt; 1 Tatooine     172    77\n#&gt; 2 Tatooine     167    75\n#&gt; 3 Naboo         96    32\n#&gt; 4 Tatooine     202   136\n#&gt; # i 83 more rows\n</pre></div>\n<p>Functions like <code>tidyr::pivot_longer()</code> don't take variables with\ndots. In this case use <code>c()</code> to select multiple variables:\n</p>\n<div class=\"sourceCode r\"><pre>iris %&gt;% pivot_longer(c(Sepal.Length, Petal.Length))\n#&gt; # A tibble: 300 x 5\n#&gt;   Sepal.Width Petal.Width Species name         value\n#&gt;         &lt;dbl&gt;       &lt;dbl&gt; &lt;fct&gt;   &lt;chr&gt;        &lt;dbl&gt;\n#&gt; 1         3.5         0.2 setosa  Sepal.Length   5.1\n#&gt; 2         3.5         0.2 setosa  Petal.Length   1.4\n#&gt; 3         3           0.2 setosa  Sepal.Length   4.9\n#&gt; 4         3           0.2 setosa  Petal.Length   1.4\n#&gt; # i 296 more rows\n</pre></div>\n\n\n<h4>Operators:</h4>\n\n<p>The <code>:</code> operator selects a range of consecutive variables:\n</p>\n<div class=\"sourceCode r\"><pre>starwars %&gt;% select(name:mass)\n#&gt; # A tibble: 87 x 3\n#&gt;   name           height  mass\n#&gt;   &lt;chr&gt;           &lt;int&gt; &lt;dbl&gt;\n#&gt; 1 Luke Skywalker    172    77\n#&gt; 2 C-3PO             167    75\n#&gt; 3 R2-D2              96    32\n#&gt; 4 Darth Vader       202   136\n#&gt; # i 83 more rows\n</pre></div>\n<p>The <code>!</code> operator negates a selection:\n</p>\n<div class=\"sourceCode r\"><pre>starwars %&gt;% select(!(name:mass))\n#&gt; # A tibble: 87 x 11\n#&gt;   hair_color skin_color  eye_color birth_year sex   gender    homeworld species\n#&gt;   &lt;chr&gt;      &lt;chr&gt;       &lt;chr&gt;          &lt;dbl&gt; &lt;chr&gt; &lt;chr&gt;     &lt;chr&gt;     &lt;chr&gt;  \n#&gt; 1 blond      fair        blue            19   male  masculine Tatooine  Human  \n#&gt; 2 &lt;NA&gt;       gold        yellow         112   none  masculine Tatooine  Droid  \n#&gt; 3 &lt;NA&gt;       white, blue red             33   none  masculine Naboo     Droid  \n#&gt; 4 none       white       yellow          41.9 male  masculine Tatooine  Human  \n#&gt; # i 83 more rows\n#&gt; # i 3 more variables: films &lt;list&gt;, vehicles &lt;list&gt;, starships &lt;list&gt;\n\niris %&gt;% select(!c(Sepal.Length, Petal.Length))\n#&gt; # A tibble: 150 x 3\n#&gt;   Sepal.Width Petal.Width Species\n#&gt;         &lt;dbl&gt;       &lt;dbl&gt; &lt;fct&gt;  \n#&gt; 1         3.5         0.2 setosa \n#&gt; 2         3           0.2 setosa \n#&gt; 3         3.2         0.2 setosa \n#&gt; 4         3.1         0.2 setosa \n#&gt; # i 146 more rows\n\niris %&gt;% select(!ends_with(\"Width\"))\n#&gt; # A tibble: 150 x 3\n#&gt;   Sepal.Length Petal.Length Species\n#&gt;          &lt;dbl&gt;        &lt;dbl&gt; &lt;fct&gt;  \n#&gt; 1          5.1          1.4 setosa \n#&gt; 2          4.9          1.4 setosa \n#&gt; 3          4.7          1.3 setosa \n#&gt; 4          4.6          1.5 setosa \n#&gt; # i 146 more rows\n</pre></div>\n<p><code>&amp;</code> and <code>|</code> take the intersection or the union of two selections:\n</p>\n<div class=\"sourceCode r\"><pre>iris %&gt;% select(starts_with(\"Petal\") &amp; ends_with(\"Width\"))\n#&gt; # A tibble: 150 x 1\n#&gt;   Petal.Width\n#&gt;         &lt;dbl&gt;\n#&gt; 1         0.2\n#&gt; 2         0.2\n#&gt; 3         0.2\n#&gt; 4         0.2\n#&gt; # i 146 more rows\n\niris %&gt;% select(starts_with(\"Petal\") | ends_with(\"Width\"))\n#&gt; # A tibble: 150 x 3\n#&gt;   Petal.Length Petal.Width Sepal.Width\n#&gt;          &lt;dbl&gt;       &lt;dbl&gt;       &lt;dbl&gt;\n#&gt; 1          1.4         0.2         3.5\n#&gt; 2          1.4         0.2         3  \n#&gt; 3          1.3         0.2         3.2\n#&gt; 4          1.5         0.2         3.1\n#&gt; # i 146 more rows\n</pre></div>\n<p>To take the difference between two selections, combine the <code>&amp;</code> and\n<code>!</code> operators:\n</p>\n<div class=\"sourceCode r\"><pre>iris %&gt;% select(starts_with(\"Petal\") &amp; !ends_with(\"Width\"))\n#&gt; # A tibble: 150 x 1\n#&gt;   Petal.Length\n#&gt;          &lt;dbl&gt;\n#&gt; 1          1.4\n#&gt; 2          1.4\n#&gt; 3          1.3\n#&gt; 4          1.5\n#&gt; # i 146 more rows\n</pre></div>\n\n\n\n<h3>See Also</h3>\n\n<p>Other single table verbs: \n<code>arrange()</code>,\n<code>filter()</code>,\n<code>mutate()</code>,\n<code>reframe()</code>,\n<code>rename()</code>,\n<code>slice()</code>,\n<code>summarise()</code>\n</p>\n\n<hr /><div style=\"text-align: center;\">[Package <em>dplyr</em> version 1.1.4 ]</div>","text/latex":"\\inputencoding{utf8}\n\\HeaderA{select}{Keep or drop columns using their names and types}{select}\n\\keyword{single table verbs}{select}\n%\n\\begin{Description}\\relax\nSelect (and optionally rename) variables in a data frame, using a concise\nmini-language that makes it easy to refer to variables based on their name\n(e.g. \\code{a:f} selects all columns from \\code{a} on the left to \\code{f} on the\nright) or type (e.g. \\code{where(is.numeric)} selects all numeric columns).\n%\n\\begin{SubSection}{Overview of selection features}\n\nTidyverse selections implement a dialect of R where operators make\nit easy to select variables:\n\\begin{itemize}\n\n\\item{} \\code{:} for selecting a range of consecutive variables.\n\\item{} \\code{!} for taking the complement of a set of variables.\n\\item{} \\code{\\&} and \\code{|} for selecting the intersection or the union of two\nsets of variables.\n\\item{} \\code{c()} for combining selections.\n\n\\end{itemize}\n\n\nIn addition, you can use \\strong{selection helpers}. Some helpers select specific\ncolumns:\n\\begin{itemize}\n\n\\item{} \\code{\\LinkA{everything()}{everything()}}: Matches all variables.\n\\item{} \\code{\\LinkA{last\\_col()}{last.Rul.col()}}: Select last variable, possibly with an offset.\n\\item{} \\code{\\LinkA{group\\_cols()}{group.Rul.cols}}: Select all grouping columns.\n\n\\end{itemize}\n\n\nOther helpers select variables by matching patterns in their names:\n\\begin{itemize}\n\n\\item{} \\code{\\LinkA{starts\\_with()}{starts.Rul.with()}}: Starts with a prefix.\n\\item{} \\code{\\LinkA{ends\\_with()}{ends.Rul.with()}}: Ends with a suffix.\n\\item{} \\code{\\LinkA{contains()}{contains()}}: Contains a literal string.\n\\item{} \\code{\\LinkA{matches()}{matches()}}: Matches a regular expression.\n\\item{} \\code{\\LinkA{num\\_range()}{num.Rul.range()}}: Matches a numerical range like x01, x02, x03.\n\n\\end{itemize}\n\n\nOr from variables stored in a character vector:\n\\begin{itemize}\n\n\\item{} \\code{\\LinkA{all\\_of()}{all.Rul.of()}}: Matches variable names in a character vector. All\nnames must be present, otherwise an out-of-bounds error is\nthrown.\n\\item{} \\code{\\LinkA{any\\_of()}{any.Rul.of()}}: Same as \\code{all\\_of()}, except that no error is thrown\nfor names that don't exist.\n\n\\end{itemize}\n\n\nOr using a predicate function:\n\\begin{itemize}\n\n\\item{} \\code{\\LinkA{where()}{where()}}: Applies a function to all variables and selects those\nfor which the function returns \\code{TRUE}.\n\n\\end{itemize}\n\n\\end{SubSection}\n\n\\end{Description}\n%\n\\begin{Usage}\n\\begin{verbatim}\nselect(.data, ...)\n\\end{verbatim}\n\\end{Usage}\n%\n\\begin{Arguments}\n\\begin{ldescription}\n\\item[\\code{.data}] A data frame, data frame extension (e.g. a tibble), or a\nlazy data frame (e.g. from dbplyr or dtplyr). See \\emph{Methods}, below, for\nmore details.\n\n\\item[\\code{...}] <\\code{\\LinkA{tidy-select}{dplyr.Rul.tidy.Rul.select}}> One or more unquoted\nexpressions separated by commas. Variable names can be used as if they\nwere positions in the data frame, so expressions like \\code{x:y} can\nbe used to select a range of variables.\n\\end{ldescription}\n\\end{Arguments}\n%\n\\begin{Value}\nAn object of the same type as \\code{.data}. The output has the following\nproperties:\n\\begin{itemize}\n\n\\item{} Rows are not affected.\n\\item{} Output columns are a subset of input columns, potentially with a different\norder. Columns will be renamed if \\code{new\\_name = old\\_name} form is used.\n\\item{} Data frame attributes are preserved.\n\\item{} Groups are maintained; you can't select off grouping variables.\n\n\\end{itemize}\n\n\\end{Value}\n%\n\\begin{Section}{Methods}\n\nThis function is a \\strong{generic}, which means that packages can provide\nimplementations (methods) for other classes. See the documentation of\nindividual methods for extra arguments and differences in behaviour.\n\nThe following methods are currently available in loaded packages:\ndbplyr (\\code{\\LinkA{tbl\\_lazy}{tbl.Rul.lazy}}), dplyr (\\code{data.frame}).\n\\end{Section}\n%\n\\begin{Section}{Examples}\n\n\nHere we show the usage for the basic selection operators. See the\nspecific help pages to learn about helpers like \\code{\\LinkA{starts\\_with()}{starts.Rul.with}}.\n\nThe selection language can be used in functions like\n\\code{dplyr::select()} or \\code{tidyr::pivot\\_longer()}. Let's first attach\nthe tidyverse:\n\n\\begin{alltt}library(tidyverse)\n\n# For better printing\niris <- as_tibble(iris)\n\\end{alltt}\n\n\nSelect variables by name:\n\n\\begin{alltt}starwars %>% select(height)\n#> # A tibble: 87 x 1\n#>   height\n#>    <int>\n#> 1    172\n#> 2    167\n#> 3     96\n#> 4    202\n#> # i 83 more rows\n\niris %>% pivot_longer(Sepal.Length)\n#> # A tibble: 150 x 6\n#>   Sepal.Width Petal.Length Petal.Width Species name         value\n#>         <dbl>        <dbl>       <dbl> <fct>   <chr>        <dbl>\n#> 1         3.5          1.4         0.2 setosa  Sepal.Length   5.1\n#> 2         3            1.4         0.2 setosa  Sepal.Length   4.9\n#> 3         3.2          1.3         0.2 setosa  Sepal.Length   4.7\n#> 4         3.1          1.5         0.2 setosa  Sepal.Length   4.6\n#> # i 146 more rows\n\\end{alltt}\n\n\nSelect multiple variables by separating them with commas. Note how\nthe order of columns is determined by the order of inputs:\n\n\\begin{alltt}starwars %>% select(homeworld, height, mass)\n#> # A tibble: 87 x 3\n#>   homeworld height  mass\n#>   <chr>      <int> <dbl>\n#> 1 Tatooine     172    77\n#> 2 Tatooine     167    75\n#> 3 Naboo         96    32\n#> 4 Tatooine     202   136\n#> # i 83 more rows\n\\end{alltt}\n\n\nFunctions like \\code{tidyr::pivot\\_longer()} don't take variables with\ndots. In this case use \\code{c()} to select multiple variables:\n\n\\begin{alltt}iris %>% pivot_longer(c(Sepal.Length, Petal.Length))\n#> # A tibble: 300 x 5\n#>   Sepal.Width Petal.Width Species name         value\n#>         <dbl>       <dbl> <fct>   <chr>        <dbl>\n#> 1         3.5         0.2 setosa  Sepal.Length   5.1\n#> 2         3.5         0.2 setosa  Petal.Length   1.4\n#> 3         3           0.2 setosa  Sepal.Length   4.9\n#> 4         3           0.2 setosa  Petal.Length   1.4\n#> # i 296 more rows\n\\end{alltt}\n\n%\n\\begin{SubSection}{Operators:}\n\nThe \\code{:} operator selects a range of consecutive variables:\n\n\\begin{alltt}starwars %>% select(name:mass)\n#> # A tibble: 87 x 3\n#>   name           height  mass\n#>   <chr>           <int> <dbl>\n#> 1 Luke Skywalker    172    77\n#> 2 C-3PO             167    75\n#> 3 R2-D2              96    32\n#> 4 Darth Vader       202   136\n#> # i 83 more rows\n\\end{alltt}\n\n\nThe \\code{!} operator negates a selection:\n\n\\begin{alltt}starwars %>% select(!(name:mass))\n#> # A tibble: 87 x 11\n#>   hair_color skin_color  eye_color birth_year sex   gender    homeworld species\n#>   <chr>      <chr>       <chr>          <dbl> <chr> <chr>     <chr>     <chr>  \n#> 1 blond      fair        blue            19   male  masculine Tatooine  Human  \n#> 2 <NA>       gold        yellow         112   none  masculine Tatooine  Droid  \n#> 3 <NA>       white, blue red             33   none  masculine Naboo     Droid  \n#> 4 none       white       yellow          41.9 male  masculine Tatooine  Human  \n#> # i 83 more rows\n#> # i 3 more variables: films <list>, vehicles <list>, starships <list>\n\niris %>% select(!c(Sepal.Length, Petal.Length))\n#> # A tibble: 150 x 3\n#>   Sepal.Width Petal.Width Species\n#>         <dbl>       <dbl> <fct>  \n#> 1         3.5         0.2 setosa \n#> 2         3           0.2 setosa \n#> 3         3.2         0.2 setosa \n#> 4         3.1         0.2 setosa \n#> # i 146 more rows\n\niris %>% select(!ends_with(\"Width\"))\n#> # A tibble: 150 x 3\n#>   Sepal.Length Petal.Length Species\n#>          <dbl>        <dbl> <fct>  \n#> 1          5.1          1.4 setosa \n#> 2          4.9          1.4 setosa \n#> 3          4.7          1.3 setosa \n#> 4          4.6          1.5 setosa \n#> # i 146 more rows\n\\end{alltt}\n\n\n\\code{\\&} and \\code{|} take the intersection or the union of two selections:\n\n\\begin{alltt}iris %>% select(starts_with(\"Petal\") & ends_with(\"Width\"))\n#> # A tibble: 150 x 1\n#>   Petal.Width\n#>         <dbl>\n#> 1         0.2\n#> 2         0.2\n#> 3         0.2\n#> 4         0.2\n#> # i 146 more rows\n\niris %>% select(starts_with(\"Petal\") | ends_with(\"Width\"))\n#> # A tibble: 150 x 3\n#>   Petal.Length Petal.Width Sepal.Width\n#>          <dbl>       <dbl>       <dbl>\n#> 1          1.4         0.2         3.5\n#> 2          1.4         0.2         3  \n#> 3          1.3         0.2         3.2\n#> 4          1.5         0.2         3.1\n#> # i 146 more rows\n\\end{alltt}\n\n\nTo take the difference between two selections, combine the \\code{\\&} and\n\\code{!} operators:\n\n\\begin{alltt}iris %>% select(starts_with(\"Petal\") & !ends_with(\"Width\"))\n#> # A tibble: 150 x 1\n#>   Petal.Length\n#>          <dbl>\n#> 1          1.4\n#> 2          1.4\n#> 3          1.3\n#> 4          1.5\n#> # i 146 more rows\n\\end{alltt}\n\n\\end{SubSection}\n\n\\end{Section}\n%\n\\begin{SeeAlso}\\relax\nOther single table verbs: \n\\code{\\LinkA{arrange}{arrange}()},\n\\code{\\LinkA{filter}{filter}()},\n\\code{\\LinkA{mutate}{mutate}()},\n\\code{\\LinkA{reframe}{reframe}()},\n\\code{\\LinkA{rename}{rename}()},\n\\code{\\LinkA{slice}{slice}()},\n\\code{\\LinkA{summarise}{summarise}()}\n\\end{SeeAlso}","text/plain":"select                  package:dplyr                  R Documentation\n\n_\bK_\be_\be_\bp _\bo_\br _\bd_\br_\bo_\bp _\bc_\bo_\bl_\bu_\bm_\bn_\bs _\bu_\bs_\bi_\bn_\bg _\bt_\bh_\be_\bi_\br _\bn_\ba_\bm_\be_\bs _\ba_\bn_\bd _\bt_\by_\bp_\be_\bs\n\n_\bD_\be_\bs_\bc_\br_\bi_\bp_\bt_\bi_\bo_\bn:\n\n     Select (and optionally rename) variables in a data frame, using a\n     concise mini-language that makes it easy to refer to variables\n     based on their name (e.g. ‘a:f’ selects all columns from ‘a’ on\n     the left to ‘f’ on the right) or type (e.g. ‘where(is.numeric)’\n     selects all numeric columns).\n\n  _\bO_\bv_\be_\br_\bv_\bi_\be_\bw _\bo_\bf _\bs_\be_\bl_\be_\bc_\bt_\bi_\bo_\bn _\bf_\be_\ba_\bt_\bu_\br_\be_\bs:\n\n       Tidyverse selections implement a dialect of R where operators\n       make it easy to select variables:\n\n         • ‘:’ for selecting a range of consecutive variables.\n\n         • ‘!’ for taking the complement of a set of variables.\n\n         • ‘&’ and ‘|’ for selecting the intersection or the union of\n           two sets of variables.\n\n         • ‘c()’ for combining selections.\n\n       In addition, you can use *selection helpers*. Some helpers\n       select specific columns:\n\n         • ‘everything()’: Matches all variables.\n\n         • ‘last_col()’: Select last variable, possibly with an offset.\n\n         • ‘group_cols()’: Select all grouping columns.\n\n       Other helpers select variables by matching patterns in their\n       names:\n\n         • ‘starts_with()’: Starts with a prefix.\n\n         • ‘ends_with()’: Ends with a suffix.\n\n         • ‘contains()’: Contains a literal string.\n\n         • ‘matches()’: Matches a regular expression.\n\n         • ‘num_range()’: Matches a numerical range like x01, x02, x03.\n\n       Or from variables stored in a character vector:\n\n         • ‘all_of()’: Matches variable names in a character vector.\n           All names must be present, otherwise an out-of-bounds error\n           is thrown.\n\n         • ‘any_of()’: Same as ‘all_of()’, except that no error is\n           thrown for names that don't exist.\n\n       Or using a predicate function:\n\n         • ‘where()’: Applies a function to all variables and selects\n           those for which the function returns ‘TRUE’.\n\n\n_\bU_\bs_\ba_\bg_\be:\n\n     select(.data, ...)\n     \n_\bA_\br_\bg_\bu_\bm_\be_\bn_\bt_\bs:\n\n   .data: A data frame, data frame extension (e.g. a tibble), or a lazy\n          data frame (e.g. from dbplyr or dtplyr). See _Methods_,\n          below, for more details.\n\n     ...: <‘tidy-select’> One or more unquoted expressions separated by\n          commas. Variable names can be used as if they were positions\n          in the data frame, so expressions like ‘x:y’ can be used to\n          select a range of variables.\n\n_\bV_\ba_\bl_\bu_\be:\n\n     An object of the same type as ‘.data’. The output has the\n     following properties:\n\n        • Rows are not affected.\n\n        • Output columns are a subset of input columns, potentially\n          with a different order. Columns will be renamed if ‘new_name\n          = old_name’ form is used.\n\n        • Data frame attributes are preserved.\n\n        • Groups are maintained; you can't select off grouping\n          variables.\n\n_\bM_\be_\bt_\bh_\bo_\bd_\bs:\n\n     This function is a *generic*, which means that packages can\n     provide implementations (methods) for other classes. See the\n     documentation of individual methods for extra arguments and\n     differences in behaviour.\n\n     The following methods are currently available in loaded packages:\n     dbplyr (‘tbl_lazy’), dplyr (‘data.frame’).\n\n_\bE_\bx_\ba_\bm_\bp_\bl_\be_\bs:\n\n     Here we show the usage for the basic selection operators. See the\n     specific help pages to learn about helpers like ‘starts_with()’.\n\n     The selection language can be used in functions like\n     ‘dplyr::select()’ or ‘tidyr::pivot_longer()’. Let's first attach\n     the tidyverse:\n\n     library(tidyverse)\n     \n     # For better printing\n     iris <- as_tibble(iris)\n     \n     Select variables by name:\n\n     starwars %>% select(height)\n     #> # A tibble: 87 x 1\n     #>   height\n     #>    <int>\n     #> 1    172\n     #> 2    167\n     #> 3     96\n     #> 4    202\n     #> # i 83 more rows\n     \n     iris %>% pivot_longer(Sepal.Length)\n     #> # A tibble: 150 x 6\n     #>   Sepal.Width Petal.Length Petal.Width Species name         value\n     #>         <dbl>        <dbl>       <dbl> <fct>   <chr>        <dbl>\n     #> 1         3.5          1.4         0.2 setosa  Sepal.Length   5.1\n     #> 2         3            1.4         0.2 setosa  Sepal.Length   4.9\n     #> 3         3.2          1.3         0.2 setosa  Sepal.Length   4.7\n     #> 4         3.1          1.5         0.2 setosa  Sepal.Length   4.6\n     #> # i 146 more rows\n     \n     Select multiple variables by separating them with commas. Note how\n     the order of columns is determined by the order of inputs:\n\n     starwars %>% select(homeworld, height, mass)\n     #> # A tibble: 87 x 3\n     #>   homeworld height  mass\n     #>   <chr>      <int> <dbl>\n     #> 1 Tatooine     172    77\n     #> 2 Tatooine     167    75\n     #> 3 Naboo         96    32\n     #> 4 Tatooine     202   136\n     #> # i 83 more rows\n     \n     Functions like ‘tidyr::pivot_longer()’ don't take variables with\n     dots. In this case use ‘c()’ to select multiple variables:\n\n     iris %>% pivot_longer(c(Sepal.Length, Petal.Length))\n     #> # A tibble: 300 x 5\n     #>   Sepal.Width Petal.Width Species name         value\n     #>         <dbl>       <dbl> <fct>   <chr>        <dbl>\n     #> 1         3.5         0.2 setosa  Sepal.Length   5.1\n     #> 2         3.5         0.2 setosa  Petal.Length   1.4\n     #> 3         3           0.2 setosa  Sepal.Length   4.9\n     #> 4         3           0.2 setosa  Petal.Length   1.4\n     #> # i 296 more rows\n     \n  _\bO_\bp_\be_\br_\ba_\bt_\bo_\br_\bs::\n\n       The ‘:’ operator selects a range of consecutive variables:\n\n       starwars %>% select(name:mass)\n       #> # A tibble: 87 x 3\n       #>   name           height  mass\n       #>   <chr>           <int> <dbl>\n       #> 1 Luke Skywalker    172    77\n       #> 2 C-3PO             167    75\n       #> 3 R2-D2              96    32\n       #> 4 Darth Vader       202   136\n       #> # i 83 more rows\n       \n       The ‘!’ operator negates a selection:\n\n       starwars %>% select(!(name:mass))\n       #> # A tibble: 87 x 11\n       #>   hair_color skin_color  eye_color birth_year sex   gender    homeworld species\n       #>   <chr>      <chr>       <chr>          <dbl> <chr> <chr>     <chr>     <chr>  \n       #> 1 blond      fair        blue            19   male  masculine Tatooine  Human  \n       #> 2 <NA>       gold        yellow         112   none  masculine Tatooine  Droid  \n       #> 3 <NA>       white, blue red             33   none  masculine Naboo     Droid  \n       #> 4 none       white       yellow          41.9 male  masculine Tatooine  Human  \n       #> # i 83 more rows\n       #> # i 3 more variables: films <list>, vehicles <list>, starships <list>\n       \n       iris %>% select(!c(Sepal.Length, Petal.Length))\n       #> # A tibble: 150 x 3\n       #>   Sepal.Width Petal.Width Species\n       #>         <dbl>       <dbl> <fct>  \n       #> 1         3.5         0.2 setosa \n       #> 2         3           0.2 setosa \n       #> 3         3.2         0.2 setosa \n       #> 4         3.1         0.2 setosa \n       #> # i 146 more rows\n       \n       iris %>% select(!ends_with(\"Width\"))\n       #> # A tibble: 150 x 3\n       #>   Sepal.Length Petal.Length Species\n       #>          <dbl>        <dbl> <fct>  \n       #> 1          5.1          1.4 setosa \n       #> 2          4.9          1.4 setosa \n       #> 3          4.7          1.3 setosa \n       #> 4          4.6          1.5 setosa \n       #> # i 146 more rows\n       \n       ‘&’ and ‘|’ take the intersection or the union of two\n       selections:\n\n       iris %>% select(starts_with(\"Petal\") & ends_with(\"Width\"))\n       #> # A tibble: 150 x 1\n       #>   Petal.Width\n       #>         <dbl>\n       #> 1         0.2\n       #> 2         0.2\n       #> 3         0.2\n       #> 4         0.2\n       #> # i 146 more rows\n       \n       iris %>% select(starts_with(\"Petal\") | ends_with(\"Width\"))\n       #> # A tibble: 150 x 3\n       #>   Petal.Length Petal.Width Sepal.Width\n       #>          <dbl>       <dbl>       <dbl>\n       #> 1          1.4         0.2         3.5\n       #> 2          1.4         0.2         3  \n       #> 3          1.3         0.2         3.2\n       #> 4          1.5         0.2         3.1\n       #> # i 146 more rows\n       \n       To take the difference between two selections, combine the ‘&’\n       and ‘!’ operators:\n\n       iris %>% select(starts_with(\"Petal\") & !ends_with(\"Width\"))\n       #> # A tibble: 150 x 1\n       #>   Petal.Length\n       #>          <dbl>\n       #> 1          1.4\n       #> 2          1.4\n       #> 3          1.3\n       #> 4          1.5\n       #> # i 146 more rows\n       \n_\bS_\be_\be _\bA_\bl_\bs_\bo:\n\n     Other single table verbs: ‘arrange()’, ‘filter()’, ‘mutate()’,\n     ‘reframe()’, ‘rename()’, ‘slice()’, ‘summarise()’\n"},"metadata":{}}]},{"cell_type":"code","source":"?arrange","metadata":{"execution":{"iopub.status.busy":"2024-05-03T21:09:12.877260Z","iopub.execute_input":"2024-05-03T21:09:12.879003Z","iopub.status.idle":"2024-05-03T21:09:13.080679Z"},"trusted":true},"execution_count":52,"outputs":[{"output_type":"display_data","data":{"text/html":"\n<table width=\"100%\" summary=\"page for arrange {dplyr}\"><tr><td>arrange {dplyr}</td><td style=\"text-align: right;\">R Documentation</td></tr></table>\n\n<h2>Order rows using column values</h2>\n\n<h3>Description</h3>\n\n<p><code>arrange()</code> orders the rows of a data frame by the values of selected\ncolumns.\n</p>\n<p>Unlike other dplyr verbs, <code>arrange()</code> largely ignores grouping; you\nneed to explicitly mention grouping variables (or use  <code>.by_group = TRUE</code>)\nin order to group by them, and functions of variables are evaluated\nonce per data frame, not once per group.\n</p>\n\n\n<h3>Usage</h3>\n\n<pre>\narrange(.data, ..., .by_group = FALSE)\n\n## S3 method for class 'data.frame'\narrange(.data, ..., .by_group = FALSE, .locale = NULL)\n</pre>\n\n\n<h3>Arguments</h3>\n\n<table summary=\"R argblock\">\n<tr valign=\"top\"><td><code>.data</code></td>\n<td>\n<p>A data frame, data frame extension (e.g. a tibble), or a\nlazy data frame (e.g. from dbplyr or dtplyr). See <em>Methods</em>, below, for\nmore details.</p>\n</td></tr>\n<tr valign=\"top\"><td><code>...</code></td>\n<td>\n<p>&lt;<code>data-masking</code>&gt; Variables, or\nfunctions of variables. Use <code>desc()</code> to sort a variable in descending\norder.</p>\n</td></tr>\n<tr valign=\"top\"><td><code>.by_group</code></td>\n<td>\n<p>If <code>TRUE</code>, will sort first by grouping variable. Applies to\ngrouped data frames only.</p>\n</td></tr>\n<tr valign=\"top\"><td><code>.locale</code></td>\n<td>\n<p>The locale to sort character vectors in.\n</p>\n\n<ul>\n<li><p> If <code>NULL</code>, the default, uses the <code>\"C\"</code> locale unless the\n<code>dplyr.legacy_locale</code> global option escape hatch is active. See the\ndplyr-locale help page for more details.\n</p>\n</li>\n<li><p> If a single string from <code>stringi::stri_locale_list()</code> is supplied, then\nthis will be used as the locale to sort with. For example, <code>\"en\"</code> will\nsort with the American English locale. This requires the stringi package.\n</p>\n</li>\n<li><p> If <code>\"C\"</code> is supplied, then character vectors will always be sorted in the\nC locale. This does not require stringi and is often much faster than\nsupplying a locale identifier.\n</p>\n</li></ul>\n\n<p>The C locale is not the same as English locales, such as <code>\"en\"</code>,\nparticularly when it comes to data containing a mix of upper and lower case\nletters. This is explained in more detail on the locale\nhelp page under the <code style=\"white-space: pre;\">Default locale</code> section.</p>\n</td></tr>\n</table>\n\n\n<h3>Details</h3>\n\n\n\n<h4>Missing values</h4>\n\n<p>Unlike base sorting with <code>sort()</code>, <code>NA</code> are:\n</p>\n\n<ul>\n<li><p> always sorted to the end for local data, even when wrapped with <code>desc()</code>.\n</p>\n</li>\n<li><p> treated differently for remote data, depending on the backend.\n</p>\n</li></ul>\n\n\n\n\n<h3>Value</h3>\n\n<p>An object of the same type as <code>.data</code>. The output has the following\nproperties:\n</p>\n\n<ul>\n<li><p> All rows appear in the output, but (usually) in a different place.\n</p>\n</li>\n<li><p> Columns are not modified.\n</p>\n</li>\n<li><p> Groups are not modified.\n</p>\n</li>\n<li><p> Data frame attributes are preserved.\n</p>\n</li></ul>\n\n\n\n<h3>Methods</h3>\n\n<p>This function is a <strong>generic</strong>, which means that packages can provide\nimplementations (methods) for other classes. See the documentation of\nindividual methods for extra arguments and differences in behaviour.\n</p>\n<p>The following methods are currently available in loaded packages:\ndbplyr (<code>tbl_lazy</code>), dplyr (<code>data.frame</code>).\n</p>\n\n\n<h3>See Also</h3>\n\n<p>Other single table verbs: \n<code>filter()</code>,\n<code>mutate()</code>,\n<code>reframe()</code>,\n<code>rename()</code>,\n<code>select()</code>,\n<code>slice()</code>,\n<code>summarise()</code>\n</p>\n\n\n<h3>Examples</h3>\n\n<pre>\narrange(mtcars, cyl, disp)\narrange(mtcars, desc(disp))\n\n# grouped arrange ignores groups\nby_cyl &lt;- mtcars %&gt;% group_by(cyl)\nby_cyl %&gt;% arrange(desc(wt))\n# Unless you specifically ask:\nby_cyl %&gt;% arrange(desc(wt), .by_group = TRUE)\n\n# use embracing when wrapping in a function;\n# see ?rlang::args_data_masking for more details\ntidy_eval_arrange &lt;- function(.data, var) {\n  .data %&gt;%\n    arrange({{ var }})\n}\ntidy_eval_arrange(mtcars, mpg)\n\n# Use `across()` or `pick()` to select columns with tidy-select\niris %&gt;% arrange(pick(starts_with(\"Sepal\")))\niris %&gt;% arrange(across(starts_with(\"Sepal\"), desc))\n</pre>\n\n<hr /><div style=\"text-align: center;\">[Package <em>dplyr</em> version 1.1.4 ]</div>","text/latex":"\\inputencoding{utf8}\n\\HeaderA{arrange}{Order rows using column values}{arrange}\n\\methaliasA{arrange.data.frame}{arrange}{arrange.data.frame}\n\\keyword{single table verbs}{arrange}\n%\n\\begin{Description}\\relax\n\\code{arrange()} orders the rows of a data frame by the values of selected\ncolumns.\n\nUnlike other dplyr verbs, \\code{arrange()} largely ignores grouping; you\nneed to explicitly mention grouping variables (or use  \\code{.by\\_group = TRUE})\nin order to group by them, and functions of variables are evaluated\nonce per data frame, not once per group.\n\\end{Description}\n%\n\\begin{Usage}\n\\begin{verbatim}\narrange(.data, ..., .by_group = FALSE)\n\n## S3 method for class 'data.frame'\narrange(.data, ..., .by_group = FALSE, .locale = NULL)\n\\end{verbatim}\n\\end{Usage}\n%\n\\begin{Arguments}\n\\begin{ldescription}\n\\item[\\code{.data}] A data frame, data frame extension (e.g. a tibble), or a\nlazy data frame (e.g. from dbplyr or dtplyr). See \\emph{Methods}, below, for\nmore details.\n\n\\item[\\code{...}] <\\code{\\LinkA{data-masking}{data.Rdash.masking}}> Variables, or\nfunctions of variables. Use \\code{\\LinkA{desc()}{desc}} to sort a variable in descending\norder.\n\n\\item[\\code{.by\\_group}] If \\code{TRUE}, will sort first by grouping variable. Applies to\ngrouped data frames only.\n\n\\item[\\code{.locale}] The locale to sort character vectors in.\n\\begin{itemize}\n\n\\item{} If \\code{NULL}, the default, uses the \\code{\"C\"} locale unless the\n\\code{dplyr.legacy\\_locale} global option escape hatch is active. See the\n\\LinkA{dplyr-locale}{dplyr.Rdash.locale} help page for more details.\n\\item{} If a single string from \\code{\\LinkA{stringi::stri\\_locale\\_list()}{stringi::stri.Rul.locale.Rul.list()}} is supplied, then\nthis will be used as the locale to sort with. For example, \\code{\"en\"} will\nsort with the American English locale. This requires the stringi package.\n\\item{} If \\code{\"C\"} is supplied, then character vectors will always be sorted in the\nC locale. This does not require stringi and is often much faster than\nsupplying a locale identifier.\n\n\\end{itemize}\n\n\nThe C locale is not the same as English locales, such as \\code{\"en\"},\nparticularly when it comes to data containing a mix of upper and lower case\nletters. This is explained in more detail on the \\LinkA{locale}{dplyr.Rdash.locale}\nhelp page under the \\AsIs{Default locale} section.\n\\end{ldescription}\n\\end{Arguments}\n%\n\\begin{Details}\\relax\n%\n\\begin{SubSection}{Missing values}\n\nUnlike base sorting with \\code{sort()}, \\code{NA} are:\n\\begin{itemize}\n\n\\item{} always sorted to the end for local data, even when wrapped with \\code{desc()}.\n\\item{} treated differently for remote data, depending on the backend.\n\n\\end{itemize}\n\n\\end{SubSection}\n\n\\end{Details}\n%\n\\begin{Value}\nAn object of the same type as \\code{.data}. The output has the following\nproperties:\n\\begin{itemize}\n\n\\item{} All rows appear in the output, but (usually) in a different place.\n\\item{} Columns are not modified.\n\\item{} Groups are not modified.\n\\item{} Data frame attributes are preserved.\n\n\\end{itemize}\n\n\\end{Value}\n%\n\\begin{Section}{Methods}\n\nThis function is a \\strong{generic}, which means that packages can provide\nimplementations (methods) for other classes. See the documentation of\nindividual methods for extra arguments and differences in behaviour.\n\nThe following methods are currently available in loaded packages:\ndbplyr (\\code{\\LinkA{tbl\\_lazy}{tbl.Rul.lazy}}), dplyr (\\code{data.frame}).\n\\end{Section}\n%\n\\begin{SeeAlso}\\relax\nOther single table verbs: \n\\code{\\LinkA{filter}{filter}()},\n\\code{\\LinkA{mutate}{mutate}()},\n\\code{\\LinkA{reframe}{reframe}()},\n\\code{\\LinkA{rename}{rename}()},\n\\code{\\LinkA{select}{select}()},\n\\code{\\LinkA{slice}{slice}()},\n\\code{\\LinkA{summarise}{summarise}()}\n\\end{SeeAlso}\n%\n\\begin{Examples}\n\\begin{ExampleCode}\narrange(mtcars, cyl, disp)\narrange(mtcars, desc(disp))\n\n# grouped arrange ignores groups\nby_cyl <- mtcars %>% group_by(cyl)\nby_cyl %>% arrange(desc(wt))\n# Unless you specifically ask:\nby_cyl %>% arrange(desc(wt), .by_group = TRUE)\n\n# use embracing when wrapping in a function;\n# see ?rlang::args_data_masking for more details\ntidy_eval_arrange <- function(.data, var) {\n  .data %>%\n    arrange({{ var }})\n}\ntidy_eval_arrange(mtcars, mpg)\n\n# Use `across()` or `pick()` to select columns with tidy-select\niris %>% arrange(pick(starts_with(\"Sepal\")))\niris %>% arrange(across(starts_with(\"Sepal\"), desc))\n\\end{ExampleCode}\n\\end{Examples}","text/plain":"arrange                 package:dplyr                  R Documentation\n\n_\bO_\br_\bd_\be_\br _\br_\bo_\bw_\bs _\bu_\bs_\bi_\bn_\bg _\bc_\bo_\bl_\bu_\bm_\bn _\bv_\ba_\bl_\bu_\be_\bs\n\n_\bD_\be_\bs_\bc_\br_\bi_\bp_\bt_\bi_\bo_\bn:\n\n     ‘arrange()’ orders the rows of a data frame by the values of\n     selected columns.\n\n     Unlike other dplyr verbs, ‘arrange()’ largely ignores grouping;\n     you need to explicitly mention grouping variables (or use\n     ‘.by_group = TRUE’) in order to group by them, and functions of\n     variables are evaluated once per data frame, not once per group.\n\n_\bU_\bs_\ba_\bg_\be:\n\n     arrange(.data, ..., .by_group = FALSE)\n     \n     ## S3 method for class 'data.frame'\n     arrange(.data, ..., .by_group = FALSE, .locale = NULL)\n     \n_\bA_\br_\bg_\bu_\bm_\be_\bn_\bt_\bs:\n\n   .data: A data frame, data frame extension (e.g. a tibble), or a lazy\n          data frame (e.g. from dbplyr or dtplyr). See _Methods_,\n          below, for more details.\n\n     ...: <‘data-masking’> Variables, or functions of variables. Use\n          ‘desc()’ to sort a variable in descending order.\n\n.by_group: If ‘TRUE’, will sort first by grouping variable. Applies to\n          grouped data frames only.\n\n .locale: The locale to sort character vectors in.\n\n            • If ‘NULL’, the default, uses the ‘\"C\"’ locale unless the\n